css:
.conflict-resolved {
  background: rgba(255, 255, 255, 0.07);
}
.conflict-ours {
  background: #6a882e;
}
.conflict-ours.cursor-line {
  background: #4d6221;
}
.conflict-theirs {
  background: #3d7e86;
}
.conflict-theirs.cursor-line {
  background: #2d5d63;
}
.conflict-dirty {
  background: #736113;
}
.conflict-dirty.cursor-line {
  background: #9e861b;
}
